description:
Outline Planning Application for:

The demolition of the existing buildings comprising of 412 dwellings and 350 sq.m (Gross Internal Area) of non-residential floorspace, and the development of a residential led mixed use scheme of replacement buildings comprising of:

Residential (Use Class C3) up to 884 dwellings, of which up to 1,010 sq.m (GIA) can be Business (Use Class B1);
Mixed use of Retail (Use Class A1), Financial and professional services (Use Class A2), Restaurants and café (Use Class A3), Drinking establishments (Use Class A4), Hot food takeaways (Use Class A5), Community/Health uses (Use Class D1), and Assembly and leisure (Use Class D2) up to 950 sq.m (GIA);
Vehicular and cycle parking (to basement, semi-basement, under-croft and surface level);

Together with associated areas of open space, hard and soft landscaping; alterations to new pedestrian and vehicular accesses and highway and engineering works; electricity sub-station and other utility requirements, including an energy centre; and other associated temporary works or structures.
